skill_info.description:
Add a block to your Mycroft configuration file like this:

```
"ChromecastSkill": {
"cc_device": "YourDeviceName",
}
```

"EmailSkill": {
"server": "imap.example.com",
"username": "InsertUsernameHere!",
"password": "InsertPasswordHere!",
"inbox": "Inbox",
}

The skill can be configured to run scripts from easily pronouncable human utterances, such as "generate report" in the example.

```json
"CmdSkill": {
"alias": {
"generate report": "/home/forslund/scripts/generate_report.sh"
}
}
```

The configuration above will launch `/home/forslund/scripts/generate_report.sh` when the second utterance under usage is invoked.

Add a block to your `~/.mycroft/mycroft.conf` file like this:

```
"PollenSkill": {
"zipcode": yourziphere
}
```

Add a block to your `~/.mycroft/mycroft.conf` file like this:

```
"TrafficSkill": {
"api_key": "REPLACETHISWITHKEYFROMGOOGLE",
"pois": {
"default": {
"destinations": {
"work": "1 Main Street, Beverly Hills, CA 90210"
},
"origins": {
"home": "350 5th Ave, New York, NY 10118"
}
}
}
}
```
* Google API key can be obtained [HERE](https://developers.google.com/maps/documentation/directions/start#get-a-key)
